import React, { Component } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import Navbar from "../../components/layout/Navbar";
import Sidenav from "../../components/layout/Sidenav"
import "./Dashboard.css";

class Dashboard extends Component {
  
render() {
    
return (
      <div>
        <Navbar />
        <Sidenav />
        <div className="container valign-wrapper">
          <div className="rows">
            <ol className="breadcrumb" >
              <li type="none">
                <Link to="/dashboard">
                  <em class="fa fa-dashboard" style={{color: "#FF9933"}}></em>
                  </Link>
              </li>
              <li style={{color: "#FF9933", marginLeft: "5px"}} type="none">/ Dashboard</li>
            </ol>
          </div>
        </div>

                
     
          <div class="container col-lg-12 valign-wrapper">
          </div>
          <div class="col-lg-8">
            <div class="panel panel-default">
              <div class="panel-heading">Our Company</div>
              <div class="panel-body" >
                <textarea name="content">
                  LODESTAR is an investment holding company which also involves with Technology.
                </textarea>	
                </div>
              
              </div>
          </div>	
        </div>
     
     
    );
  }
}

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps
)(Dashboard);
